request.description:
# Guest Session New

This endpoint makes an HTTP GET request to create a new guest session.

## Request

- Method: `GET`

- URL: `{{authUrl}}/guest_session/new`


## Response

The response for this request is a JSON object with the following schema:

``` json
{
  "type": "object",
  "properties": {
    "success": {
      "type": "boolean"
    },
    "guest_session_id": {
      "type": "string"
    },
    "expires_at": {
      "type": "string"
    }
  }
}

 ```

